import './App.css';
import Dashboard from './daily.js'

function App() {
  return (
    <div>
      <Profile/>

      <div id="dashboard-container">
        <Daily
          activity="Work"
          hours="5hrs"
          lastWeek="Previous - 7hrs"
        />
      </div>    
    </div>
  );
}

export default App;
